import {Table} from 'antd'

function App(){
    return(
        <div>
            <Table
            columns={[
                {
                    title: 'Nome',
                    dataIndex: 'name',
                },
                {
                    title: 'Email',
                    dataIndex: 'email',
                },
                {
                    title: 'Genêro',
                    dataIndex: 'gender'
                },
                {
                    title: 'Data de Nascimento',
                    dataIndex: 'birthDate',
                },
                {
                    title: 'Telefone',
                    dataIndex: 'phone'

                }
            ]}
            ></Table>
        </div>        

    );
}

export default App
